import React from 'react'

const ReportList = ({title, description}) => {
  return (
    <div className="reportlist">
      <p>{created_at}</p>
      <h1>{title}</h1>
      <p>{description}</p>
      <button>Delete</button>
      <button>Update</button>
    </div>
  )
}

export default ReportList
